import React, { useState } from 'react';

const GitHubAnalyzer = () => {
  const [username, setUsername] = useState('');
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const [result, setResult] = useState(null);

  const handleAnalyze = async (e) => {
    e.preventDefault();
    setError('');
    setResult(null);
    setLoading(true);
    try {
      const response = await fetch('/api/github-analyze', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ username })
      });
      const data = await response.json();
      if (!response.ok) throw new Error(data.error || 'Unknown error');
      setResult(data);
    } catch (err) {
      setError(err.message);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="max-w-3xl mx-auto mt-16 bg-slate-800/50 rounded-xl p-8 shadow-xl border border-slate-700/30">
      <h2 className="text-2xl font-bold mb-4 text-white">GitHub Analyzer</h2>
      <form onSubmit={handleAnalyze} className="flex items-center space-x-4 mb-6">
        <input
          type="text"
          placeholder="Enter GitHub username"
          value={username}
          onChange={e => setUsername(e.target.value)}
          className="flex-1 px-4 py-2 rounded bg-slate-900 text-white border border-slate-700 focus:outline-none"
          required
        />
        <button
          type="submit"
          className="px-6 py-2 rounded bg-indigo-500 hover:bg-indigo-600 text-white font-semibold"
          disabled={loading}
        >
          {loading ? 'Analyzing...' : 'Analyze'}
        </button>
      </form>
      {error && <div className="text-red-500 mb-4">{error}</div>}
      {result && (
        <div>
          <div className="mb-6">
            <h3 className="text-lg font-semibold text-white mb-2">Summary (Paragraph)</h3>
            <div className="bg-slate-900 text-gray-200 p-4 rounded text-base mb-4">
              {result.summary_paragraph || "No summary paragraph returned from analysis."}
            </div>
            <h3 className="text-lg font-semibold text-white mb-2">Detailed Summary</h3>
            <pre className="bg-slate-900 text-gray-200 p-4 rounded overflow-x-auto whitespace-pre-wrap text-sm">
              {result.summary || "No detailed summary returned from analysis."}
            </pre>
          </div>
          <div className="mb-6">
            <h3 className="text-lg font-semibold text-white mb-2">Contribution Heatmap</h3>
            <img
              src={`data:image/png;base64,${result.heatmap}`}
              alt="Contribution Heatmap"
              className="rounded border border-slate-700"
              style={{ maxWidth: '100%' }}
            />
          </div>
          <div className="mb-6">
            <h3 className="text-lg font-semibold text-white mb-2">Score</h3>
            <div className="text-2xl font-bold text-indigo-400">{result.score}/100</div>
          </div>
        </div>
      )}
    </div>
  );
};

export default GitHubAnalyzer;
